import React, { useState } from 'react'

export default function Todos(l, todo) {
    console.log(l)
    console.log(todo)

    const [todos, SetTodos] = useState([])
    SetTodos([
        ...todos,
       {key: l, todo: todo}
      ]);
  return (
    <div>

        <ul>
        {todos.map(t => (
          <li key={t.key}>{t.key} {t.todo}</li>
        ))}
      </ul>
    </div>
  )
}
